import './Collection.css';
import { Col, Container, Row } from "react-bootstrap";

function Collection(){

    const ArraysOfCollection = [{

    }];
    const ArraysOfCollectionOnMap = ArraysOfCollection.map((ArrayOfCollection) =>
    
    <Col key = {ArrayOfCollection.id} lg = "4" md = "6">
        <img src = {ArrayOfCollection.image} className='w-100' />

        <div className = "text-center">
            <h1>{ArrayOfCollection.title}</h1>
            <p>{ArrayOfCollection.text}</p>
        </div>
    </Col>
);

    return(
        <Container className = "collection">
            
            <div className = "text-center">
                <h1>Hottest Collections</h1>
                <p>Risus commodo id odio turpis pharetra elementum. Pulvinar porta porta feugiat scelerisque in elit. Morbi rhoncus, tellus, eros consequat magna semper orci a tincidunt. </p>
            </div>

            <Row>
                {ArraysOfCollectionOnMap}
            </Row>
        </Container>
    )
}

export default Collection
